import React from 'react';
import { Duck } from './demo';

interface Props {
    duck: Duck;
}

export function DuckItem({duck}: Props) {

    return (
        <div key={duck.name}>
            <span>{duck.name}</span>
            <button onClick={() => duck.makeSound(duck.name + 'quack')}>Make sound</button>
        </div>
    )
}
